import { Component } from "react";
import "../css/ColorContent.css"

class ColorContent extends Component {
    state = {
        mainColor: "#fff",
        secondaryColor: "#fff",
        accentColor: "#fff"
    }

    render() {
        return <div className="color-content-body">
            <div className="color-picker-div"></div>
            <div className="additional-color-div"></div>
            <div className="color-scheme-div"></div>
        </div>
    }
}

export default ColorContent;
